import React from 'react'
import './FlowEmailInput.css'

function FlowEmailInput() {
  return (
    <div className="input-with-button">
    <input
      type="text"
      className="text-input"
      placeholder="Enter your email"
    />
    <button className="send-button">
     <img src='send.png'></img> {/* Unicode for a triangle pointing right */}
    </button>
  </div>
);
};
  
export default FlowEmailInput
